BEGIN TRANSACTION;
CREATE TABLE "schema_migrations" ("version" varchar(255) NOT NULL);
DELETE FROM sqlite_sequence;
CREATE TABLE "homes" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "mls_number" integer, "price" integer, "square_feet" integer, "short_sale" boolean, "address" varchar(255), "favorite" boolean, "created_at" datetime, "updated_at" datetime, "active" boolean, "viewed" date, "interested" boolean);
CREATE UNIQUE INDEX "unique_schema_migrations" ON "schema_migrations" ("version");
COMMIT;